import React from 'react';
import { useNavigate } from "react-router-dom";
import HomeIcon from './homeIcon';
import './index.css';

const Navbar = ({ children }) => {
  const navigate = useNavigate();

  const handleHomeClick = () => {
    navigate(`/`);
    // Aquí puedes agregar la lógica para restablecer la búsqueda y mostrar todos los productos
    // Por ejemplo, si tienes los estados setSearchTerm y setSearchResults en tu componente App.js:
    // setSearchTerm("");
    // setSearchResults([]);
  };

  return (
    <div className='navbar-container'>
      <HomeIcon onClick={handleHomeClick} />
      {children}
    </div>
  );
};

export default Navbar;
